func Test_nextGreaterElements(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		// fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, nextGreaterElements(tc.nums), ":%v", tc)
	}
}

func Benchmark_nextGreaterElements(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			nextGreaterElements(tc.nums)
		}
	}
}
